import {
  Container,
  Divider,
  Paper,
  Typography,
  Box,
  Grid,
  Card,
  CardMedia,
} from "@mui/material";
import React from "react";
import { styles } from "./styles";
const AddPostPage = () => {
  return (
    <Container sx={{ paddingTop: 5, paddingLeft: 2 }}>
      <Typography sx={{ fontSize: 20 }}>Add Post</Typography>
      <Paper elevation={3} sx={styles.container}>
        <Card
          sx={{
            display: "flex",
            flexDirection: "column",
            justifyContent: "space-between",
            borderRadius: "15px",
            height: "100%",
            position: "relative",
          }}
        >
          <CardMedia
            sx={{
              height: 194,
              paddingTop: "56.25%",
              backgroundColor: "rgba(0, 0, 0, 0.5)",
              backgroundBlendMode: "darken",
            }}
            image="https://www.history.com/.image/ar_4:3%2Cc_fill%2Ccs_srgb%2Cfl_progressive%2Cq_auto:good%2Cw_1200/MTU3ODc5MDg2NDMyNjU5MTY3/morning-light-on-4.jpg"
            title="image"
          />
        </Card>
        <Divider orientation="vertical" variant="middle" flexItem />
        <Grid container spacing={2}>
          <Grid item xs={6}>
            <Typography sx={{ fontSize: 16 }}>Rahul Patil</Typography>
          </Grid>
          <Grid item xs={6}>
            <Typography sx={{ fontSize: 16 }}>This is me</Typography>
          </Grid>
        </Grid>
      </Paper>
    </Container>
  );
};

export default AddPostPage;
